CREATE TABLE m_emblem(
  id INTEGER NOT NULL,
  name TEXT NOT NULL,
  description TEXT NOT NULL,
  emblem_type INTEGER NOT NULL,
  grade INTEGER,
  emblem_asset_path TEXT NOT NULL,
  emblem_clear_condition_type INTEGER NOT NULL,
  emblem_clear_condition_param INTEGER,
  is_emblem_secret_condition INTEGER NOT NULL,
  is_event_emblem INTEGER NOT NULL,
  released_at INTEGER NOT NULL,
  PRIMARY KEY (id)
);
